import React from "react";
import "../App.css";
import {
    Nav,
    NavLink,
    Bars,
    NavMenu,
    NavBtn,
    NavBtnLink,
} from "./NavBar";

const NavBar = () => {
    return (
        <>
            <Nav>
                <Bars />
                <NavMenu>
                    <NavLink to='/Home' activateStyle>
                        Home
                    </NavLink>
                    <NavLink to='/Bot' activateStyle>
                        Bot
                    </NavLink>
                    <NavLink to='/Saved' activateStyle>
                        Saved
                    </NavLink>
                </NavMenu>
                <NavBtn>
                    <NavBtnLink to='/SignIn'>Sign In</NavBtnLink>
                </NavBtn>
            </Nav>
        </>
    );
};

export default NavBar;
